import React from 'react';
import { useFormik } from 'formik';
import * as Yup from 'yup';

const ProfileForm = ({ initialValues, onSubmit }) => {
    const formik = useFormik({
        initialValues,
        validationSchema: Yup.object({
            email: Yup.string().email('Invalid email address').required('Required'),
            handicap: Yup.number().required('Required')
        }),
        onSubmit
    });

    return (
        <form onSubmit={formik.handleSubmit}>
            <div className="form-group">
                <label htmlFor="email">Email</label>
                <input
                    id="email"
                    name="email"
                    type="email"
                    className={`form-control ${formik.touched.email && formik.errors.email ? 'is-invalid' : ''}`}
                    {...formik.getFieldProps('email')}
                />
                {formik.touched.email && formik.errors.email ? (
                    <div className="invalid-feedback">{formik.errors.email}</div>
                ) : null}
            </div>

            <div className="form-group">
                <label htmlFor="handicap">Handicap</label>
                <input
                    id="handicap"
                    name="handicap"
                    type="number"
                    className={`form-control ${formik.touched.handicap && formik.errors.handicap ? 'is-invalid' : ''}`}
                    {...formik.getFieldProps('handicap')}
                />
                {formik.touched.handicap && formik.errors.handicap ? (
                    <div className="invalid-feedback">{formik.errors.handicap}</div>
                ) : null}
            </div>

            <button type="submit" className="btn btn-primary">Update Profile</button>
        </form>
    );
};

export default ProfileForm;
